@Override
public final Bits bits() {
  return (acceptDocs == null) ? new Bits() {
    public boolean get(int docid) {
      return matchDoc(docid);
    }

    public int length() {
      return maxDoc;
    }
  } : new Bits() {
    public boolean get(int docid) {
      return acceptDocs.get(docid) && matchDoc(docid);
    }

    public int length() {
      return maxDoc;
    }
  };
}

